j=A.HL("TactiTrak is an AI-powered football analysis system that processes match footage to deliver advanced tactical insights. It detects players, ball, referees, and goalkeepers using models like YOLO and ByteTrack, and classifies players by team. The system features Zone Control, which divides the pitch into six zones and determines team dominance in each based on player distribution. Additionally, Pass Line Detection identifies all available passing options when a player is in possession, helping analyze decision-making and team positioning. TactiTrak is available as both a desktop and mobile application, offering flexibility for analysts, coaches, and fans to use it in different environments.",A.av(["\ud83d\ude80 Key Features",A.b(["- Detect and track all essential entities on the field, including players, referees, goalkeepers, and the ball.","- Maintain persistent identity tracking across frames, even during occlusions or quick transitions."],k),"\ud83d\udd35 Team Classification",A.b(["- Using clustering techniques such as KMeans combined with jersey color analysis.- Using clustering techniques such as KMeans combined with jersey color analysis."],k),"\ud83d\udc40 Zone Control",A.b(["Divides the pitch into six tactical zones.","Calculates which team dominates each zone based on player distribution."],k),"\u2714 Pass Line Detection",A.b(["Identifies all valid passing options when a player is in possession of the ball.Visualizes pass lines to support decision-making analysis."],k),"\ud83d\udca1 Ball Possession Tracking",A.b(["Tracks and estimates ball possession over time by each team."],k),"\ud83d\udcbb Platforms",A.b(["Desktop application.","Mobile application."],k)],i,h),"https://github.com/MostafaBaherr/TactiTrackFlutter/blob/main/README.md",n,o,j,"Flutter,python(YOLO,flask)","TactiTrack","TactiTrack \u2013 AI-Powered Football Match Analysis System","2025")
