q=A.HL("Developed Cinelist, a mobile application designed for professionals in the audiovisual industry to streamline the creation and management of equipment lists during pre production. The app delivers a fast, intuitive, and fully customizable experience, enabling directors, cinematographers, gaffers, grips, and other crew members to efficiently manage gear by department or project. Built with scalability in mind, Cinelist supports both small and large-scale productions minimizing human error, enhancing organization, and accelerating workflows.\n",A.av(["\ud83d\ude80 Key Features",A.b(["Intuitive and user-friendly interface for fast list creation.","Fully customizable equipment lists per department or project.","Saves time and effort by eliminating tedious manual processes.","Ensures nothing is overlooked during pre-production.","Ideal for small productions or large-scale operations."],k),"\ud83c\udfaf Role-Based Benefits",A.b(["Directors: Oversee all departments and track essential gear.","Cinematographers & Photographers: Organize cameras, lenses, and lighting kits.","Gaffers: Manage and customize lighting equipment lists.","Key Grip: Detail rigging and support gear for smooth setups.","Dolly Grip: Track dollies and related accessories with ease.","Audio: Compile essential sound equipment for quality audio.","Assistant Camera: Handle filters, lenses, and accessories checklists.","DIT: Organize data management and monitoring gear for post-production.","Video Assist: List playback monitors and recording devices for crew feedback.","VFX: Structure specialized tools for seamless visual effects integration.","Set Designers: Gather props and materials efficiently for production.","Production: Track gear across departments to maintain workflow integrity."],k),"\u2728 Why Cinelist",A.b(["Boosts efficiency and accuracy in the pre-production process.","Reduces costly mistakes by ensuring complete equipment coverage.","Empowers every department with tailored tools.","Fits naturally into any AV production workflow."],k)],i,h),n,"https://play.google.com/store/apps/details?id=com.cine_list",m,q,"Flutter (firebase,cubit),","Cinelist","\ud83c\udfac Cinelist: Smart Equipment List Manager for AV Professionals","2025")
